lt;li&gt; deserialize time: 168.84 s &lt;/li&gt;\n&lt;li&gt; transfer time: 6.36 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.0.160:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 128 &lt;/li&gt;\n          &lt;li&gt; Threads: 3072 &lt;/li&gt;\n          &lt;li&gt; Memory: 21.59 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][::2]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.perf_counter()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.perf_counter() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"format":"0.0b"},"id":"1366","type":"NumeralTickFormatter"},{"attributes":{"source":{"id":"1213"}},"id":"1341","type":"CDSView"},{"attributes":{},"id":"1474","type":"AllLabels"},{"attributes":{},"id":"1455","type":"AllLabels"},{"attributes":{},"id":"1435","type":"BasicTickFormatter"},{"attributes":{"data":{"bandwidth":[1,2],"bandwidth_text":["1","2"],"destination":["a","b"],"source":["a","b"]},"selected":{"id":"1507"},"selection_policy":{"id":"1506"}},"id":"1150","type":"ColumnDataSource"},{"attributes":{"coordinates":null,"formatter":{"id":"1435"},"group":null,"major_label_policy":{"id":"1436"},"ticker":{"id":"1089"},"visible":false},"id":"1088","type":"LinearAxis"},{"attributes":{},"id":"1290","type":"LinearScale"},{"attributes":{},"id":"1436","type":"AllLabels"},{"attributes":{"callback":null},"id":"1092","type":"TapTool"},{"attributes":{"child":{"id":"1400"},"title":"Scheduler Logs"},"id":"1410","type":"Panel"},{"attributes":{},"id":"1321","type":"Selection"},{"attributes":{"axis":{"id":"1088"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1091","type":"Grid"},{"attributes":{},"id":"1078","type":"DataRange1d"},{"attributes":{"child":{"id":"1401"},"title":"Summary"},"id":"1402","type":"Panel"},{"attributes":{},"id":"1080","type":"LinearScale"},{"attributes":{},"id":"1085","type":"BasicTicker"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"below":[{"id":"1378"}]
